// App.js
// import React, { useEffect, useState } from 'react';
import { AuthProvider } from './web/AuthContext';
import Logout from './web/cmpts/Logout';
import Login from './web/cmpts/Login';
import Navbar from './web/Design/Navbar'

function App() {
  return (
    <AuthProvider>
      <Navbar />
      <Login />

      <Logout />
    </AuthProvider>
  );
}

export default App;
